css:
.git-plus .error {
  color: #e2c08d;
}
.git-plus .success {
  color: #73c990;
}
.git-plus .atom-panel.modal.from-bottom {
  width: 600px;
}
.git-plus.info-view {
  overflow: auto;
  max-height: 30vh;
}
.select-list-buttons {
  margin-top: 5px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
atom-text-editor .source.diff .unimportant,
atom-text-editor::shadow .source.diff .unimportant {
  color: #47494a;
}
atom-text-editor .source.diff .info,
atom-text-editor::shadow .source.diff .info {
  color: #de935f;
}
atom-text-editor .source.diff .deletion,
atom-text-editor::shadow .source.diff .deletion {
  color: #cc6666;
}
atom-text-editor .source.diff .insertion,
atom-text-editor::shadow .source.diff .insertion {
  color: #b5bd68;
}
atom-text-editor .source.diff .markup.removed.diff,
atom-text-editor::shadow .source.diff .markup.removed.diff,
atom-text-editor .source.diff .meta.diff.header.from-file,
atom-text-editor::shadow .source.diff .meta.diff.header.from-file {
  border-bottom: 2px solid #cc6666;
}
atom-text-editor .source.diff .markup.added.diff,
atom-text-editor::shadow .source.diff .markup.added.diff,
atom-text-editor .source.diff .meta.diff.header.to-file,
atom-text-editor::shadow .source.diff .meta.diff.header.to-file {
  border-bottom: 2px solid #b5bd68;
}
.git-plus-log {
  background-color: #1d1f21;
  overflow-y: auto;
}
.git-plus-log #git-plus-commits {
  color: #a3a8ae;
  cursor: pointer;
}
.git-plus-log #git-plus-commits td {
  padding: 8px 10px;
  border-bottom: 1px solid #000;
  vertical-align: top;
}
.git-plus-log #git-plus-commits .author {
  width: 30%;
}
.git-plus-log #git-plus-commits .date {
  width: 25%;
}
.git-plus-log #git-plus-commits .message {
  width: 50%;
}
.git-plus-log #git-plus-commits .hashShort {
  width: 10%;
  text-align: right;
}
